// File: frontend/src/pages/Home.jsx
import React from "react";
import "./Home.css";

export default function Home() {
  return (
    <div className="home-container">
      <div className="greeting">
        <h1 className="animated-text">Welcome to CrackerMart</h1>
        <p>Your one-stop shop for all festive fireworks!</p>
      </div>

      <div className="slideshow">
        <div className="slides">
          <img src="/images/slide1.jpg" alt="Fireworks 1" />
          <img src="/images/slide2.jpg" alt="Fireworks 2" />
          <img src="/images/slide3.jpg" alt="Fireworks 3" />
        </div>
      </div>
    </div>
  );
}
